import styled from "styled-components";

const StyleNav = styled.div`
`



export default function RespNavbar() {
  return (
    <StyleNav>
      <nav>
        <ul>
          <li>Home</li>
          <li>About</li>
          <li>Info</li>
          <li>Contact</li>
        </ul>
      </nav>
    </StyleNav>
  );
}
